import React from 'react';
import HttpsRedirect from 'react-https-redirect';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import CampusPunch from './CampusPunch.jsx';

function App() {
  return (
    <div>
      <HttpsRedirect>
        <Router>
          <Route exact path="/" component={CampusPunch} />
          <Route exact path="/:action" component={CampusPunch} />
          <Route exact path="/:action/:type" component={CampusPunch} />
          {/* <Route exact path="/:action/:type/:option" component={CampusPunch} /> */}
          {/* <Route exact path="/:action/:type/:option/:thisform" component={CampusPunch} /> */}
        </Router>
      </HttpsRedirect>
    </div>
  );
}

export default App;
